import React from 'react' ;
import { BrowserRouter as  Route, Switch } from 'react-router-dom';

import Sidebar from '../Sidebar/Sidebar'
import Footer from '../../layout/Footer/Footer'

const Dash = () => {

    return (
        <div className=''>   
              <Sidebar />
              <Switch>  
                <Route exact path='/u/admin/home' component={Dash}/>
                <Route exact path='/u/admin/requests' component={Dash}/>
                <Route exact path='/u/admin/budget' component={Dash}/>
              </Switch>
              <Footer />
        </div>
    )
}

export default Dash ;
